script: |
  super -f text -I q1909.spq | sort > q1909.out

inputs:
  - name: q1909.spq
    data: |
      SELECT DISTINCT + ( 81 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1909.out
    data: |
      81
